import React, { useState } from "react";
import "../styles/header.css";

export default function Header() {
  const [menuOpen, setMenuOpen] = useState(false);

  return (
    <header className="wn-header">
      <div className="wn-container wn-header-container">
        <a href="/" className="wn-logo-area">
          <img src="/logo192.png" alt="WhatNew" className="wn-logo" />
          <h1 className="wn-title">WhatNew</h1>
        </a>

        <nav className={`wn-nav ${menuOpen ? "open" : ""}`}>
          <ul>
         
            <li><a href="/sell">Become a Seller</a></li>
          
          </ul>
        </nav>

        <button
          className="wn-burger"
          onClick={() => setMenuOpen(!menuOpen)}
          aria-label="Toggle menu"
        >
          <div className="bar"></div>
          <div className="bar"></div>
          <div className="bar"></div>
        </button>
      </div>
    </header>
  );
}
